import React from 'react';
import About from './About';
import Slider from './Slider';
import Reviews from './Reviews';
import Footer from './Footer';

function Main() {
  return (
    <div className="main">
      <About />
      <Slider />
      <Reviews />
      <Footer />
    </div>
  );
}

export default Main;
